import { useState } from "react";

import "../style/ourBrands.css";

function OurBrands() {
	const [BrandList, setBrandList] = useState([
		"data:image/png;base64,",
		"data:image/png;base64,",
		"data:image/png;base64,",
		"data:image/png;base64,",
		"data:image/jpeg;base64,",
		"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQtr4eo_5wxuXBncfLBqeUXRqKMANllw2w-Cw&usqp=CAU",
		"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTq70iCsTmpLj-eFBo7N4sxrPWyFa1V-jGpsg&usqp=CAU",
	]);
	return (
		<div id='our_brand_container'>
			<div id='brands_text_container'>
				<div id='brands_text'>Brand</div>
				<div id='brands_decoration'></div>
				<div id='collection_link'></div>
			</div>
			<div id='brands_imgs_container'>
				{BrandList.map((element, index) => {
					return <img alt='Brand logo' key={index} src={element} />;
				})}
			</div>
		</div>
	);
}

export default OurBrands;
